import React, { Component } from "react";
import { Link } from "react-router-dom";

class Clientitem extends Component {
  render() {
    const { client } = this.props;
    return (
      <tr className="even pointer">
        <td className="a-center ">cccccc</td>
        <td className="a-center ">ffff</td>
        <td className="a-center ">cvvv </td>
        <td className="a-center ">rrrr</td>
        <td className="a-center ">tttt</td>
        <td>
          <Link to="/update/:id">Modifier</Link> <br />
          <Link to="">Supprimer</Link>
        </td>
      </tr>
    );
  }
}

export default Clientitem;
